import React, { Component } from 'react';

class Footer extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (
            <div>
                <footer className="footer"></footer>
                <span className="text-muted">All right Reserved 2021@Talukder</span>
            </div>
        );
    }
}

export default Footer;
